import React, {Component} from "react"

class ContactComponent extends Component{
  render(){
    return(
      <div>
        <p className="text-24pt"
           style={{width:"100%", paddingTop: "100px", textAlign:"center"}}>
           Contact Us!
        </p>
      </div>
    )
  }
}

export default ContactComponent;
